void print_mat(const std::vector<int>& M, int rows, int cols)
{
    if(M.size() == 0) {
        std::cout << "empty matrix" << std::endl;
    } else if(M.size() != rows*cols) {
        std::cout << "Wrong size: " << M.size() << " != " << rows << "*" << cols << std::endl;
    } else {
        for(int i = 0; i < rows; ++i) {
            std::cout << "  ";
            for(int j = 0; j < cols; ++j) {
                std::cout << M[i*cols+j] << " ";
            }
            std::cout << std::endl;
        }
    }
}

